member.example:
The following example queries a single analysis result value.

using Tekla.Structures.Analysis;

public class Example
{
       public void Example1()
       {
           int PartId = 0;

           AnalysisResult AnalysisResult = new AnalysisResult();

           AnalysisResult.ObjectType = AnalysisResult.ObjectTypeEnum.OBJECT_TYPE_PART;
           AnalysisResult.ObjectId = PartId;
           AnalysisResult.LoadCase = (int)AnalysisResult.LoadCaseForMinMaxEnum.LOADCASE_WITH_MAX_ABSOLUTE_VALUE;
           AnalysisResult.Position = AnalysisResult.ResultPositionEnum.POSITION_BEAM_START_POINT;
           AnalysisResult.PositionCoordX = 0.0;
           AnalysisResult.PositionCoordY = 0.0;
           AnalysisResult.PositionCoordZ = 0.0;
           AnalysisResult.PositionTolerance = 0.1;
           AnalysisResult.ValueType = AnalysisResult.ValueTypeEnum.VALUETYPE_SHEAR_Y;

           bool Result = AnalysisResult.QueryAnalysisResult();

           double ResultValue = AnalysisResult.Value;
       }
}

Get the shear value from the load case with the minimum axial force value.

AnalysisResult.ValueType = AnalysisResult.ValueTypeEnum.VALUETYPE_SHEAR_Y;
AnalysisResult.LoadCase = (int)AnalysisResult.LoadCaseForMinMaxEnum.LOADCASE_WITH_MIN_FX_VALUE;

Insert analysis result using analysis bar number.

var analysisResult = new AnalysisResult();
analysisResult.ObjectType = AnalysisResult.ObjectTypeEnum.OBJECT_TYPE_MEMBER;
analysisResult.ObjectId = analysisBar.Label.Number;
analysisResult.Position = AnalysisResult.ResultPositionEnum.POSITION_BEAM_START_POINT;
analysisResult.ValueType = AnalysisResult.ValueTypeEnum.VALUETYPE_SHEAR_Y;
analysisResult.LoadCase = 1;
analysisResult.LoadCaseName = "ULS1";
analysisResult.LoadCaseType = LoadCaseTypeEnum.COMBINATION_ULS;
analysisResult.LoadCaseInfo = "TSD class: Gravity";
analysisResult.Value = 100000.0;
var result = analysisResult.Insert();

The following example queries the available analysis result positions for the object.

using Tekla.Structures.Analysis;
using System.Collections;

public class Example
{
       public void Example1()
       {
           int PartId = 0;

           AnalysisResultPositions ResultPositions = new AnalysisResultPositions();

           ResultPositions.ObjectType = AnalysisResult.ObjectTypeEnum.OBJECT_TYPE_PART;
           ResultPositions.ObjectId = PartId;

           bool Result = ResultPositions.GetResultPositions();

           ArrayList ValuePositions = ResultPositions.aPositions;
           ArrayList ValuePositionsX = ResultPositions.aPositionsX;
           ArrayList ValuePositionsY = ResultPositions.aPositionsY;
           ArrayList ValuePositionsZ = ResultPositions.aPositionsZ;
       }
}
